import React from 'react';
import { Field } from '../../../../../lib/components/form/Field';
import { Form } from '../../../../../lib/components/form/Form';
import './LoginForm.scss';

export default function LoginForm({ authUrl, dashboardUrl }) {
  const [error, setError] = React.useState(null);

  const onSuccess = (response) => {
    if (!response.error) {
      window.location.href = dashboardUrl;
    } else {
      setError(response.error.message);
    }
  };

  return (
    <div className="admin-login-form">
      <div className="flex items-center justify-center mb-3">
        <img width={60} height={60} alt="EverShop Admin Panel" src="data:image/jpeg;base64," />
      </div>
      {error && <div className="text-critical py-1">{error}</div>}
      <Form
        action={authUrl}
        method="POST"
        id="adminLoginForm"
        isJSON
        onSuccess={onSuccess}
        btnText="Login"
      >
        <Field
          name="email"
          type="email"
          label="Email"
          placeholder="Email"
          validationRules={['notEmpty', 'email']}
        />
        <Field
          name="password"
          type="password"
          label="Password"
          placeholder="Password"
          validationRules={['notEmpty']}
        />
      </Form>
    </div>
  );
}

export const layout = {
  areaId: 'content',
  sortOrder: 10
};

export const query = `
  query Query {
    authUrl: url(routeId: "createAdminUserSession")
    dashboardUrl: url(routeId: "dashboard")
  }
`;
